import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link, Navigate } from 'react-router-dom';
import SignupPage from './components/signup';
import LoginPage from './components/login';
import HomePage from './components/home';
import Dashboard from './components/dashboard';
import ProfilePage from './components/Profile';
import MapPage from './components/MapPage'; // Import the new map component
import Encyclopedia from './components/Encyclopedia';


import './App.css';

const App = () => {
    return (
        <Router>
            <div className="navbar">
                <div className="logo">Wild Track</div>
                <ul>
                    <li><Link to="/home">Home</Link></li>
                    <li><Link to="/map">Map</Link></li>
                    <li><Link to="/Encyclopedia">Encyclopedia</Link></li>
                    <li><Link to="/profile">Profile</Link></li>
                </ul>
                <div className="auth-links">
                    <Link to="/login">Login</Link>
                    <Link to="/signup">Sign Up</Link>
                </div>
            </div>
            <Routes>
                <Route path="/" element={<Navigate to="/login" replace />} /> {/* Redirect default to login */}
                <Route path="/signup" element={<SignupPage />} />
                <Route path="/login" element={<LoginPage />} />
                <Route path="/home" element={<HomePage />} />
                <Route path="/dashboard" element={<Dashboard />} />
                <Route path="/profile" element={<ProfilePage />} />
                <Route path="/map" element={<MapPage />} />
                <Route path="/Encyclopedia" element={<Encyclopedia />} />

                <Route path="*" element={<NotFound />} /> {/* Not Found route */}
            </Routes>
        </Router>
    );
};

// Simple Not Found component
const NotFound = () => {
    return (
        <div>
            <h2>404 - Not Found</h2>
            <p>The page you are looking for does not exist.</p>
        </div>
    );
};

export default App;
